// src/components/About/About.js
import React from 'react';
import styles from './About.module.css';

function About() {
  return (
    <section className={styles.about}>
      <div className={styles.aboutContent}>
        <div className={styles.image}>
          <img src="/images/about.jpg" alt="About Us" className={styles.imageImg}/>
        </div>
        <div className={styles.text}>
          <h3 className={styles.textTitle}>About Us</h3>
          <p className={styles.textFirst}>Brief description of the company or team.</p>
          <hr className={styles.textHr}/>
          <p className={styles.textLast}>Detailed description of the company or team, including history, mission, and vision.</p>
        </div>
      </div>
    </section>
  );
}

export default About;
